// useData.js
import { useEffect, useState } from 'react';
import { csv } from 'd3';

export const useData = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        csv('/dataku.csv')
            .then(rawData => {
                // Log raw data for debugging
                console.log("Raw Data:", rawData);

                const processedData = rawData.map(d => ({
                    Timestamp: new Date(d.Timestamp), // Convert to a Date object
                    HRV: +d.HRV, // Convert HRV to a number
                    coords: d['Location Coordinates'].split(',')
                              .map(coord => +coord.trim()), // Coordinates as numbers
                }));

                // Log processed data for debugging
                console.log("Processed Data:", processedData);
                setData(processedData); // Store processed data
            })
            .catch(error => {
                console.error("Error loading data:", error);
            });
    }, []);

    return data; // Return the processed data
};
